/* ACTION TYPE CONSTANTS

You can use any convention you wish here, but the name should remain UPPER_SNAKE_CASE for consistency.

*/

const LOG_IN = 'app_main/auth/LOG_IN';
const LOG_IN_SUCCESS = 'app_main/auth/LOG_IN_SUCCESS';
const LOGIN_FAILED = 'app_main/auth/LOGIN_FAILED';
const LOG_OUT = 'app_main/auth/LOG_OUT';

export default {
	LOG_IN,
	LOG_IN_SUCCESS,
	LOGIN_FAILED,
	LOG_OUT,
};
